import React from "react";
import {
  AboContainer,
  Abowrapper,
  AboRow,
  Column1,
  textWrapper,
} from "./AboutElements";

export const AboutSection = () => {
  return (
    <>
      <AboContainer>
        <Abowrapper>
          <AboRow>
            <Column1>
              <textWrapper>
                <topLine></topLine>
              </textWrapper>
            </Column1>
          </AboRow>
        </Abowrapper>
      </AboContainer>
    </>
  );
};
